-- create views
create view facilities as
  select
    asset_id,
    parent,
    place,
    name,
    description,
    category,
    latitude,
    longitude,
    area
  from assets
  where category = 'F'
  order by asset_id;

create view appliances as
  select
    asset_id,
    parent,
    place,
    name,
    description,
    category,
    manufacturer,
    serialnum,
    model,
    price,
    warranty
  from assets
  where category = 'A'
  order by asset_id;

-- create functions
create or replace function register_user (
  person_attributes persons,
  input_password text
) returns persons
language plpgsql
strict
security definer
as $$
declare
  new_user persons;
begin

    person_id,
    email,
    forename,
    surname,
    phone,
    cellphone,
    department_id,
    contract_id,
    category
  ) values (
    default,
    person_attributes.email,
    person_attributes.forename,
    person_attributes.surname,
    person_attributes.phone,
    person_attributes.cellphone,
    person_attributes.department_id,
    person_attributes.contract_id,
    person_attributes.category
  ) returning * into new_user;
  
    person_id,
    password_hash,
    created_at,
    updated_at,
    is_active
  ) values (
    new_user.person_id,
    crypt(input_password, gen_salt('bf', 10)),
    now(),
    now(),
    true
  );

  return new_user;

end; $$;

create or replace function authenticate (
  input_email    text,
  input_password text
) returns integer
language sql
stable
strict
security definer
as $$
  select p.person_id
    from persons as p
    join private.accounts as a using(person_id)
    where p.email = input_email
          and
          a.password_hash = crypt(input_password, a.password_hash)
          and
          a.is_active;
$$;

create or replace function create_log ()
returns trigger
language plpgsql
security definer
as $$
begin

    current_setting('auth.data.person_id')::integer,
    now(),
    tg_op,
    tg_table_name::text,
    to_jsonb(old),
    to_jsonb(new)
  );

  return null; -- result is ignored since this is an after trigger

end; $$;

